import Nav from './componete/nav'
import Pagina from './componete/pagina'
import { BrowserRouter as Router, Route} from 'react-router-dom';
import Login from './componete/login/login';
import LogoAnimado from './componete/login/logo';
import Logueo from './componete/login/usuario';
import AyudaCrud from './componete/ayuda.jsx';
import Panel from './componete';

import './App.css';

function App() {
  return (
    <>
    <Router>
      <Route exact path="/" component={LogoAnimado}/>
      <Route  path="/login" component={Login}/>
      <Route  path="/logueo" component={Logueo}/>
      <Route  path="/nav" component={Nav}/>
      <Route  path="/pagina" component={Pagina}/>
      <Route path="/ayuda" component={AyudaCrud } />
      <Route path="/" component = { Panel } />


    </Router>
    {/* <div className="App">
      <div>
      <Nav></Nav>
      </div>
      <div>
        <Pagina> </Pagina>
      </div>
    </div> */}

    </>
  );
}

export default App;
